use FFBE;

DROP TABLE Unit;
create table Unit (
	
    Unit_ID int,
    Unit_Name varchar(50),
    Sex varchar(30),
    Min_Rarity int,
    Max_Rarity int,
    Pot_ID_Type int,
    primary key (Unit_ID)
);

DROP TABLE Equipment;
create table Equipment (

	Equipment_ID int,
    Equip_Name varchar(45),
    Equip_Type varchar(30),
    primary key (Equipment_ID)
);

DROP TABLE Esper;
create table Esper (

	Esper_ID varchar(20),
	Esper_Name varchar(20),
    Esper_Rank int,
    primary key (Esper_ID)
);


DROP TABLE StatBreak;
create table StatBreak (

	Pot_ID int,
    Max_HP int,
    Max_MP int,
    Max_ATK int,
    Max_DEF int,
    Max_MAG int,
    Max_SPR int,
    primary key (Pot_ID)
);

DROP TABLE Equippable;
create table Equippable (

	Equippable_ID int,
    Large_Sword boolean,
    Sword boolean,
    Short_Sword boolean,
    Axe boolean,
    Hammer boolean,
    Flail boolean,
    Rod boolean,
    Staff boolean,
    Instrument boolean,
    Gun boolean,
    Bow boolean,
    Whip boolean,
    Fist boolean,
    Katana boolean,
    Spear boolean,
    Chakram boolean,
    Clothes boolean,
    Light_Armor boolean,
    Heavy_Armor boolean,
    Robes boolean,
    Hat boolean,
    Helmet boolean,
    Light_Shield boolean,
    Heavy_Shield boolean,
    primary key (Equippable_ID)
);

DROP TABLE Stats;
create Table Stats (

	Stats_ID varchar(25),
    F_HP double,
    F_MP double,
    F_atk double,
    F_def double,
    F_mag double,
    F_spr double,
    P_HP double,
    P_MP double,
    P_atk double,
    P_def double,
    P_mag double,
    P_spr double,
    Fire_Atk boolean,
    Ice_Atk boolean,
    Thunder_Atk boolean,
    Water_Atk boolean,
    Wind_Atk boolean,
    Earth_Atk boolean,
    Dark_Atk boolean,
    Light_Atk boolean,
    Fire_Res double,
    Ice_Res double,
    Thunder_Res double,
    Water_Res double,
    Wind_Res double,
    Earth_Res double,
    Light_Res double,
    Dark_Res double,
    Poison_Atk double,
	Silence_Atk double,
    Paralysis_Atk double,
    Confuse_Atk double,
    Stone_Atk double,
    Sleep_Atk double,
    Disease_Atk double,
    Blind_Atk double,
    Poison_Res double,
	Silence_Res double,
    Paralysis_Res double,
    Confuse_Res double,
    Stone_Res double,
    Sleep_Res double,
    Disease_Res double,
    Blind_Res double,
    primary key (Stats_ID)
);


